import '../../AboutUs.css';

function AboutUs (){
    return(
        <div className='Bodycss'>
        <div class="person">
        <div class="containerss">
          <div class="containerss-inner">
            <img
              class="circle"
              src="data:image/jpg;base64,"
            />
            <img
              class="img img1"
              src="data:image/png;base64,"
            />
          </div>
        </div>
        <div class="dividerss"></div>
        <div class="name">Alma</div>
        <div class="title">Product Manager</div>
      </div>
      <div class="person">
        
        <div class="dividerss"></div>
        <div class="name">Irma</div>
        <div class="title">Senior Developer</div>
      </div>
      <div class="person">
        <div class="containerss">
          <div class="containerss-inner">
            <img
              class="circle"
              src="data:image/jpg;base64,"
            />
            <img
              class="img img3"
              
            />
          </div>
        </div>
        <div class="dividerss"></div>
        <div class="name">Anton</div>
        <div class="title">Senior UX</div>
      </div>
      </div>
    )
}

export default AboutUs;
